function Agendamentos({ agendamentos }) {
    return ( 
        <div>
            <ul>
      {tarefas.map((tarefa) => (
        <li key={tarefa.id}>
          {tarefa.nome}, {tarefa.data}, {tarefa.descricao}
          <input
            type="checkbox"
            checked={tarefa.feita}
            onChange={() => handleTarefaCheck(tarefa)}
          />
        </li>
      ))}        
            </ul>
        </div>
    );
}

